import React from 'react'
import Image from './Image'

import fractal_1 from '../images/fractal/many_colorful_fractals.png'
import fractal_2 from '../images/fractal/many_fractals_in_the_style_of_van_gogh.png'
import fractal_3 from '../images/fractal/crystalline-fractals-repeating-into-infinity.png'
import fractal_4 from '../images/fractal/many_fractals_in_the_style_of_dr_suess.png'
import fractal_5 from '../images/fractal/a_psychedelic_trip_to_the_moon.png'
import fractal_6 from '../images/fractal/a_trip_to_the_moon.png'

function Fractal() {
    console.log(fractal_1)
    return (
        <section className="gallery min-vh-100">
            <script src="../src/bootstrap.bundle.min.js"></script>
            <div className="container-lg">
                <div className="row">
                        <Image content={{
                        source:fractal_1,
                        caption:"'many colorful fractals'"
                        }}
                        />

                        <Image content={{
                        source:fractal_2,
                        caption:"'fractals in the style of van gogh'"
                        }}
                        />

                        <Image content={{
                        source:fractal_3,
                        caption:"'crystaline fractals repeating infinitely'"
                        }} 
                        />

                        <Image content={{
                        source:fractal_4,
                        caption:"'fractals in the style of Dr. Suess'"
                        }} 
                        />

                        <Image content={{
                        source:fractal_5,
                        caption:"'a psychedelic trip to the moon'"
                        }} 
                        />

                        <Image content={{
                        source:fractal_6,
                        caption:"'a trip to the moon'"
                        }} 
                        />
                </div>
            </div>
           
<button type="button" className="btn btn-primary" data-toggle="modal" data-target="#exampleModal">
  Launch demo modal
</button>

<div className="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
  <div className="modal-dialog" modal-dialog-centered modal-lg role="document">
    <div className="modal-content">
      <div className="modal-header">
        <h5 className="modal-title" id="exampleModalLabel">Modal title</h5>
        <button type="button" className="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>
      <div className="modal-body">

      </div>
      <div className="modal-footer">
        <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
        <button type="button" className="btn btn-primary">Save changes</button>
      </div>
    </div>
  </div>
</div>
        </section>
    )
}

export default Fractal
